import React from 'react';
import './App.css';
import {Api} from './'


function App() {

const fetch =()=> {
  fetch('https://jsonplaceholder.typicode.com/posts/1')
  .then((response) => response.json())
  .then((json) => console.log(json));
}

  return (
    <div className="App">
      <button onClick={fetch}>submit</button>
    </div>
  );
}

export default App;
